import{_ as e,c as o,o as t,a as d}from"./app.d95e124d.js";const _='{"title":"JS \u57FA\u7840","description":"","frontmatter":{},"headers":[{"level":2,"title":"JS \u6570\u636E\u7C7B\u578B","slug":"js-\u6570\u636E\u7C7B\u578B"},{"level":2,"title":"JS \u6570\u636E\u7C7B\u578B\u5224\u65AD","slug":"js-\u6570\u636E\u7C7B\u578B\u5224\u65AD"},{"level":2,"title":"\u6570\u636E\u7C7B\u578B\u9690\u5F0F\u8F6C\u5316","slug":"\u6570\u636E\u7C7B\u578B\u9690\u5F0F\u8F6C\u5316"},{"level":2,"title":"this","slug":"this"}],"relativePath":"interview/JS\u57FA\u7840.md","lastUpdated":1664437294091}',i={},c=d('<h1 id="js-\u57FA\u7840" tabindex="-1">JS \u57FA\u7840 <a class="header-anchor" href="#js-\u57FA\u7840" aria-hidden="true">#</a></h1><h2 id="js-\u6570\u636E\u7C7B\u578B" tabindex="-1">JS \u6570\u636E\u7C7B\u578B <a class="header-anchor" href="#js-\u6570\u636E\u7C7B\u578B" aria-hidden="true">#</a></h2><blockquote><p>\u539F\u59CB\u7C7B\u578B\u6709\u54EA\u51E0\u79CD\uFF1Fnull \u662F\u5BF9\u8C61\u561B\uFF1F</p></blockquote><p><strong>\u539F\u59CB\u7C7B\u578B</strong> 6\u79CD\u57FA\u7840/\u539F\u59CB\u7C7B\u578B\uFF1A<code>boolean</code>\u3001<code>null</code>\u3001<code>undefined</code>\u3001<code>number</code>\u3001<code>string</code>\u3001<code>symbol</code></p><p>\u539F\u59CB\u7C7B\u578B\u5B58\u50A8\u7684\u90FD\u662F\u503C\uFF0C\u662F\u6CA1\u6709\u51FD\u6570\u53EF\u4EE5\u8C03\u7528\u7684\uFF0C\u6BD4\u5982 <code>undefined.toString()</code> \u4F1A\u62A5\u9519</p><p><code>&#39;1&#39;.toString()</code> \u662F\u53EF\u4EE5\u4F7F\u7528\u7684\u3002\u5176\u5B9E\u5728\u8FD9\u79CD\u60C5\u51B5\u4E0B\uFF0C<code>&#39;1&#39;</code> \u5DF2\u7ECF\u4E0D\u662F\u539F\u59CB\u7C7B\u578B\u4E86\uFF0C\u800C\u662F\u88AB\u5F3A\u5236\u8F6C\u6362\u6210\u4E86 <code>String</code> \u7C7B\u578B\u4E5F\u5C31\u662F\u5BF9\u8C61\u7C7B\u578B\uFF0C\u6240\u4EE5\u53EF\u4EE5\u8C03\u7528 <code>toString</code> \u51FD\u6570\u3002</p><p><code>string</code> \u7C7B\u578B\u662F\u4E0D\u53EF\u53D8\u7684\uFF0C\u65E0\u8BBA\u4F60\u5728 <code>string</code> \u7C7B\u578B\u4E0A\u8C03\u7528\u4F55\u79CD\u65B9\u6CD5\uFF0C\u90FD\u4E0D\u4F1A\u5BF9\u503C\u6709\u6539\u53D8\u3002</p><p>\u53E6\u5916\u5BF9\u4E8E <code>null</code> \u6765\u8BF4\uFF0C\u5F88\u591A\u4EBA\u4F1A\u8BA4\u4E3A\u4ED6\u662F\u4E2A\u5BF9\u8C61\u7C7B\u578B\uFF0C\u5176\u5B9E\u8FD9\u662F\u9519\u8BEF\u7684\u3002\u867D\u7136 <code>typeof null</code> \u4F1A\u8F93\u51FA <code>object</code>\uFF0C\u4F46\u662F\u8FD9\u53EA\u662F JS \u5B58\u5728\u7684\u4E00\u4E2A\u60A0\u4E45 Bug\u3002\u5728 JS \u7684\u6700\u521D\u7248\u672C\u4E2D\u4F7F\u7528\u7684\u662F 32 \u4F4D\u7CFB\u7EDF\uFF0C\u4E3A\u4E86\u6027\u80FD\u8003\u8651\u4F7F\u7528\u4F4E\u4F4D\u5B58\u50A8\u53D8\u91CF\u7684\u7C7B\u578B\u4FE1\u606F\uFF0C<code>000</code> \u5F00\u5934\u4EE3\u8868\u662F\u5BF9\u8C61\uFF0C\u7136\u800C <code>null</code> \u8868\u793A\u4E3A\u5168\u96F6\uFF0C\u6240\u4EE5\u5C06\u5B83\u9519\u8BEF\u7684\u5224\u65AD\u4E3A <code>object</code> \u3002\u867D\u7136\u73B0\u5728\u7684\u5185\u90E8\u7C7B\u578B\u5224\u65AD\u4EE3\u7801\u5DF2\u7ECF\u6539\u53D8\u4E86\uFF0C\u4F46\u662F\u5BF9\u4E8E\u8FD9\u4E2A Bug \u5374\u662F\u4E00\u76F4\u6D41\u4F20\u4E0B\u6765\u3002</p><p><strong>\u5BF9\u8C61\u7C7B\u578B</strong></p><blockquote><p>\u5BF9\u8C61\u7C7B\u578B\u548C\u539F\u59CB\u7C7B\u578B\u7684\u4E0D\u540C\u4E4B\u5904\uFF1F\u51FD\u6570\u53C2\u6570\u662F\u5BF9\u8C61\u4F1A\u53D1\u751F\u4EC0\u4E48\u95EE\u9898\uFF1F</p></blockquote><p>\u5BF9\u8C61\u7C7B\u578B\u548C\u539F\u59CB\u7C7B\u578B\u4E0D\u540C\u7684\u662F\uFF0C\u539F\u59CB\u7C7B\u578B\u5B58\u50A8\u7684\u662F\u503C\uFF0C\u5BF9\u8C61\u7C7B\u578B\u5B58\u50A8\u7684\u662F\u5730\u5740\uFF08\u6307\u9488\uFF09\u3002\u5F53\u4F60\u521B\u5EFA\u4E86\u4E00\u4E2A\u5BF9\u8C61\u7C7B\u578B\u7684\u65F6\u5019\uFF0C\u8BA1\u7B97\u673A\u4F1A\u5728\u5185\u5B58\u4E2D\u5E2E\u6211\u4EEC\u5F00\u8F9F\u4E00\u4E2A\u7A7A\u95F4\u6765\u5B58\u653E\u503C\uFF0C\u4F46\u662F\u6211\u4EEC\u9700\u8981\u627E\u5230\u8FD9\u4E2A\u7A7A\u95F4\uFF0C\u8FD9\u4E2A\u7A7A\u95F4\u4F1A\u62E5\u6709\u4E00\u4E2A\u5730\u5740\uFF08\u6307\u9488\uFF09</p><h2 id="js-\u6570\u636E\u7C7B\u578B\u5224\u65AD" tabindex="-1">JS \u6570\u636E\u7C7B\u578B\u5224\u65AD <a class="header-anchor" href="#js-\u6570\u636E\u7C7B\u578B\u5224\u65AD" aria-hidden="true">#</a></h2><blockquote><p><code>typeof</code> \u662F\u5426\u80FD\u6B63\u786E\u5224\u65AD\u7C7B\u578B\uFF1F<code>instanceof</code> \u80FD\u6B63\u786E\u5224\u65AD\u5BF9\u8C61\u7684\u539F\u7406\u662F\u4EC0\u4E48\uFF1F</p></blockquote><ul><li>typeof \u5224\u65AD\u57FA\u7840/\u539F\u59CB\u7C7B\u578B,null \u4F1A\u5224\u65AD\u6210obj, \u5176\u4ED6\u90FD\u80FD\u6B63\u786E</li><li>typeof \u5224\u65AD\u5BF9\u8C61\u7C7B\u578B,\u51FD\u6570\u4F1A\u5224\u65AD\u6210 function,\u5176\u4ED6\u90FD\u6B63\u786E\u65F6obj,\u4F46\u662F\u5224\u65AD\u4E0D\u4E86\u5177\u4F53\u7684\u7C7B\u578B</li></ul><p><code>instanceof</code> \u539F\u7406\uFF1ATODO:</p><h2 id="\u6570\u636E\u7C7B\u578B\u9690\u5F0F\u8F6C\u5316" tabindex="-1">\u6570\u636E\u7C7B\u578B\u9690\u5F0F\u8F6C\u5316 <a class="header-anchor" href="#\u6570\u636E\u7C7B\u578B\u9690\u5F0F\u8F6C\u5316" aria-hidden="true">#</a></h2><p>TODO:</p><h2 id="this" tabindex="-1">this <a class="header-anchor" href="#this" aria-hidden="true">#</a></h2><blockquote><p>\u5982\u4F55\u6B63\u786E\u5224\u65AD this\uFF1F\u7BAD\u5934\u51FD\u6570\u7684 this \u662F\u4EC0\u4E48\uFF1F</p></blockquote><p><img src="https://kingan-md-img.oss-cn-guangzhou.aliyuncs.com/blog/20220219170631.png" alt=""></p><ul><li><p>\u76F4\u63A5\u8C03\u7528 foo \uFF0C\u4E0D\u7BA1 foo \u51FD\u6570\u88AB\u653E\u5728\u4E86\u4EC0\u4E48\u5730\u65B9\uFF0Cthis \u4E00\u5B9A\u662F window</p></li><li><p>obj.foo() \uFF0C\u6211\u4EEC\u53EA\u9700\u8981\u8BB0\u4F4F\uFF0C\u8C01\u8C03\u7528\u4E86\u51FD\u6570\uFF0C\u8C01\u5C31\u662F this\uFF0Cthis \u662F obj \u5BF9\u8C61</p></li><li><p>new \u7684\u65B9\u5F0F\uFF0Cthis \u88AB\u6C38\u8FDC\u7ED1\u5B9A\u5728\u4E86 new \u51FA\u6765\u7684\u53D8\u91CF\u4E0A\u9762\uFF0C\u4E0D\u4F1A\u88AB\u4EFB\u4F55\u65B9\u5F0F\u6539\u53D8 this</p></li><li><p>\u7BAD\u5934\u51FD\u6570\u4E2D\u7684 this \u53EA\u53D6\u51B3\u5305\u88F9\u7BAD\u5934\u51FD\u6570\u7684\u7B2C\u4E00\u4E2A\u666E\u901A\u51FD\u6570\u7684 this (\u56E0\u4E3A\u7BAD\u5934\u51FD\u6570\u6CA1\u6709this,\u56E0\u6B64\u5BF9\u5305\u88F9\u7BAD\u5934\u51FD\u6570\u7684\u51FD\u6570\u4F7F\u7528bind\u4E5F\u65E0\u6CD5\u4FEE\u6539this)</p></li><li><p>new \u4E00\u4E2Aclass\u5185\u90E8\u7684\u5BF9\u8C61\u7684\u51FD\u6570\u7684\u7BAD\u5934\u51FD\u6570\uFF0C\u8FD9\u79CD\u60C5\u51B5\u6839\u636E\u4F18\u5148\u7EA7</p></li><li><p>new \u7684\u65B9\u5F0F\u4F18\u5148\u7EA7\u6700\u9AD8\uFF0C\u63A5\u4E0B\u6765\u662F bind \u8FD9\u4E9B\u51FD\u6570\uFF0C\u7136\u540E\u662F obj.foo() \u8FD9\u79CD\u8C03\u7528\u65B9\u5F0F\uFF0C\u6700\u540E\u662F\u76F4\u63A5\u8C03\u7528\u7684\u65B9\u5F0F\uFF0C\u540C\u65F6\uFF0C\u7BAD\u5934\u51FD\u6570\u7684 this \u4E00\u65E6\u88AB\u7ED1\u5B9A\uFF0C\u5C31\u4E0D\u4F1A\u518D\u88AB\u4EFB\u4F55\u65B9\u5F0F\u6240\u6539\u53D8\u3002</p></li></ul><blockquote><p>tips: <code>fn.bind(a).bind(b)</code> \u4E0D\u4F1A\u4FEE\u6539\u591A\u6B21this\u6307, \u53EA\u6709\u7B2C\u4E00\u4E2A\u4F1A\u751F\u6548, \u5177\u4F53\u539F\u56E0\u8BF7\u624B\u5199bind</p></blockquote>',22),s=[c];function l(n,a,p,r,h,u){return t(),o("div",null,s)}var f=e(i,[["render",l]]);export{_ as __pageData,f as default};
